import axios from 'axios';
const loginEntity = { "login": "letscode", "senha": "lets@123" };

const login = () => {
  const promise = axios.post('http://0.0.0.0:5000/login/', loginEntity);
  const response = promise.then((response) => console.log(response.data));
  return response;
};

export default login;
